settings._cssCustom:
.fr-pricing-tabs-kilo {
  --tab-label-color: var(--black);
  --tab-label-color-active: DarkSlateBlue;
  --plan-padding: var(--space-xxl);
}

/***** 
Navigation 
*****/

/* Tab */

.fr-pricing-tabs-kilo__plan-choice:focus-visible {
	box-shadow: none !important;
  outline: none !important;
}
.fr-pricing-tabs-kilo__plan-choice.active {
	background-color: transparent !important;
}

/* Icon */

.fr-pricing-tabs-kilo__plan-choice-icon {
	visibility: hidden;
}
.fr-pricing-tabs-kilo__plan-choice.active .fr-pricing-tabs-kilo__plan-choice-icon {
	visibility: visible;
  --icon-color: var(--tab-label-color-active);
}

/* Label */

.fr-pricing-tabs-kilo__plan-choice.active .fr-pricing-tabs-kilo__plan-choice-label,
.fr-pricing-tabs-kilo__plan-choice:hover .fr-pricing-tabs-kilo__plan-choice-label{
	color: var(--tab-label-color-active);
}

.fr-pricing-tabs-kilo__plan-features {
	columns: 2 150px;
}

.fr-pricing-tabs-kilo__plan-features > li {
	margin-bottom: var(--content-gap);
  break-inside: avoid;
}

.fr-pricing-tabs-kilo__plan-feature-icon {
	--icon-size: 1em;
  --icon-color: var(--white-trans-50);
  --icon-offset: .25em;
}

.fr-pricing-tabs-kilo__plan-feature-icon {
	fill: var(--icon-color);
  height: var(--icon-size);
  width: var(--icon-size);
  color: var(--icon-color);
  font-size: var(--icon-size);
}

.fr-pricing-tabs-kilo__plan-choice-icon {
	--icon-size: 1em;
  --icon-color: var(--black-trans-50);
}

.fr-pricing-tabs-kilo__plan-choice-icon {
	fill: var(--icon-color);
  height: var(--icon-size);
  width: var(--icon-size);
  color: var(--icon-color);
  font-size: var(--icon-size);
}
